    console.log('CSV downloader worker finished');
  }, 5000);
});
```
This code creates a web worker that will handle the CSV download. The worker will simulate a long-running task by using `setTimeout` to delay the completion of the task.

**Step 4: Create a route to handle the CSV download**

Create a new file called `csv-downloader.js` in the `app/routes` directory:
```
// app/routes/csv-downloader.js
import { Route } from '@ember/routing';
import { worker } from 'ember-web-workers';

export default class CsvDownloaderRoute extends Route {
  async csvDownload() {
    // Create a new instance of the web worker
    const worker = new Worker('csv-downloader-worker.js');

    // Send a message to the web worker to start the CSV download
    worker.postMessage('start');

    // Wait for the web worker to finish the CSV download
    await new Promise((resolve) => {
      worker.onmessage = (event) => {
        if (event.data === 'finished') {
          resolve();
        }
      };
    });

    // Send a message to the web worker to stop the CSV download
    worker.postMessage('stop');

    // Get the downloaded CSV data from the web worker
    const csvData = await worker.postMessage('get-csv-data');

    // Return the downloaded CSV data
    return csvData;
  }
}
```
