    }
  };
  recognition.onstart = () => {
    document.getElementById('start-stop').innerHTML = 'Stop';
  };
  recognition.onend = () => {
    document.getElementById('start-stop').innerHTML = 'Start';
  };
  recognition.start();
}

function formatTime() {
  const date = new Date();
  const hours = date.getHours() % 12;
  const minutes = date.getMinutes();
  const seconds = date.getSeconds();
  return `(${hours.toString().padStart(2, '0')}:${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')} ${hours < 12 ? 'AM' : 'PM'})`;
}

