Implement the following functions:
- `malloc(size_t size)`: Allocate a block of memory of `size` bytes and return a pointer to the beginning of the block. If the allocation fails, return `NULL`.
- `calloc(size_t num, size_t size)`: Allocate an array of `num` elements, each of size `size` bytes, and return a pointer to the beginning of the array. If the allocation fails, return `NULL`.
- `realloc(void* ptr, size_t size)`: Change the size of the block of memory pointed to by `ptr` to `size` bytes. If the allocation fails, return `NULL`. If `ptr` is `NULL`, behave as if `malloc(size)` was called instead.

Here is a sample implementation in C:
```c
#include <stdlib.h>
#include <stdio.h>

void* my_malloc(size_t size) {
    void* ptr = sbrk(0);
    if (sbrk(size) == (void*) -1) {
        return NULL;
    }
    return ptr;
}

void* my_calloc(size_t num, size_t size) {
    size_t total_size = num * size;
    void* ptr = my_malloc(total_size);
    if (ptr == NULL) {
        return NULL;
    }
    return ptr;
}

void* my_realloc(void* ptr, size_t size) {
    if (ptr == NULL) {
        return my_malloc(size);
    }
    void* new_ptr = sbrk(0);
    size_t old_size = sbrk(0) - (void*) ptr;
    if (sbrk(size - old_size) == (void*) -1) {
        return NULL;
    }
    return new_ptr;
}
```
This implementation uses the `sbrk` function to allocate and deallocate memory. The `my_malloc` function allocates a block of memory of the specified size, the `my_calloc` function allocates an array of the specified size, and the `my_realloc` function changes the size of the block of memory pointed to by the specified pointer.

Note that this is a very basic implementation and does not handle errors properly. In a real-world implementation, you would want to handle errors more robustly and add additional checks to ensure that the allocation and deallocation operations are successful.

Also, this implementation is not thread-safe, as it uses the `sbrk` function which is not thread-safe. In a real-world implementation, you would want to use a thread-safe memory allocation function, such as `mmap` or a memory pool.

